	public int getMin(int[] A)
	{
		Arrays.sort(A);
		int n = A.length;
		for (int i= 1; i < n; i++) {
			int g = A[i];
			for (int j = i+1; j < n; j++) {
				g = GCD(g, A[j]);
			}
			if (g > A[i-1]) return n-i;
		}
		return -1;
	}
	
    int GCD(int a, int b)
    {
        if (b == 0) return a;
        return GCD(b, a % b);
    }

	
